     1/**
     2 * Wiki Random Topic Selector
     3 *
     4 * Uses cryptographically secure randomness to select the next topic.
     5 * Priority order:
     6 * 1. Broken links (if any exist)
     7 * 2. Expansion priorities from ecosystem.json
     8 * 3. Random topic suggestion
     9 *
    10 * The random seed is based on crypto.randomBytes for true randomness.
    11 */
    12
    13import { ToolModule } from "../types.js";
    14import * as fs from "fs";
    15import * as path from "path";
    16import * as crypto from "crypto";
    17
    18const WIKI_DIR = path.join(process.cwd(), "not-wikipedia");
    19const ECOSYSTEM_FILE = path.join(process.cwd(), "ecosystem.json");
    20const RESEARCHERS_FILE = path.join(process.cwd(), "researchers.json");
    21
    22interface TopicSelection {
    23  source: "broken_link" | "expansion_priority" | "random_suggestion";
    24  topic: string;
    25  context: string;
    26  randomSeed: string;
    27  brokenLinksIndex: number | null;
    28  totalBrokenLinks: number;
    29}
    30
    31// Cryptographically secure random number between 0 and max-1
    32function secureRandomInt(max: number): number {
    33  const randomBytes = crypto.randomBytes(4);
    34  const randomValue = randomBytes.readUInt32BE(0);
    35  return randomValue % max;
    36}
    37
    38// Get all broken links
    39function getBrokenLinks(): string[] {
    40  const brokenLinks: string[] = [];
    41
    42  try {
    43    const files = fs.readdirSync(WIKI_DIR).filter(f => f.endsWith(".html"));
    44
    45    for (const file of files) {
    46      const filePath = path.join(WIKI_DIR, file);
    47      const content = fs.readFileSync(filePath, "utf-8");
    48      const linkMatches = content.matchAll(/href="([^"]*\.html)"/g);
    49
    50      for (const match of linkMatches) {
    51        const link = match[1];
    52        if (!fs.existsSync(path.join(WIKI_DIR, link))) {
    53          // Store as "target-article.html" (the missing page)
    54          if (!brokenLinks.includes(link)) {
    55            brokenLinks.push(link);
    56          }
    57        }
    58      }
    59    }
    60  } catch (error) {
    61    // Return empty array on error
    62  }
    63
    64  return brokenLinks;
    65}
    66
    67// Get expansion priorities from ecosystem.json
    68function getExpansionPriorities(): string[] {
    69  try {
    70    if (fs.existsSync(ECOSYSTEM_FILE)) {
    71      const ecosystem = JSON.parse(fs.readFileSync(ECOSYSTEM_FILE, "utf-8"));
    72      return ecosystem.expansion_priorities?.suggested_topics || [];
    73    }
    74  } catch (error) {
    75    // Return empty array on error
    76  }
    77  return [];
    78}
    79
    80// Generate random topic suggestions
    81function getRandomSuggestions(): string[] {
    82  return [
    83    "The Great Semantic Collapse of 2019",
    84    "Meaning Erosion Prevention Protocols",
    85    "Collective Amnesia Events",
    86    "Semantic Quarantine Zones",
    87    "Language Extinction Patterns",
    88    "Memory Palace Architecture",
    89    "Chronological Distortion Syndrome",
    90    "Definitional Archaeology",
    91    "Concept Migration Patterns",
    92    "Linguistic Fossil Records",
    93    "Semantic Immune Deficiency",
    94    "Meaning Bankruptcy Proceedings",
    95    "Vocabulary Inheritance Laws",
    96    "Conceptual Plate Tectonics",
    97    "Etymology Decay Curves",
    98  ];
    99}
   100
   101function selectTopic(): TopicSelection {
   102  // Generate random seed for transparency
   103  const randomSeed = crypto.randomBytes(8).toString("hex");
   104
   105  // Priority 1: Broken links
   106  const brokenLinks = getBrokenLinks();
   107  if (brokenLinks.length > 0) {
   108    const index = secureRandomInt(brokenLinks.length);
   109    const topic = brokenLinks[index].replace(".html", "").replace(/-/g, " ");
   110    return {
   111      source: "broken_link",
   112      topic: topic,
   113      context: `Fixing broken link: ${brokenLinks[index]}. This page is referenced but doesn't exist.`,
   114      randomSeed,
   115      brokenLinksIndex: index,
   116      totalBrokenLinks: brokenLinks.length,
   117    };
   118  }
