        researchers: data.researchers || {},
        suggested: data.suggested_new_researchers || [],
      };
    }
  } catch (error) {
    // Return empty on error
  }
  return { researchers: {}, suggested: [] };
}

function selectResearcher(preferNew: boolean = false): ResearcherSelection {
  const randomSeed = crypto.randomBytes(8).toString("hex");
  const { researchers, suggested } = loadResearchers();

  // If preferNew or random chance (20%), suggest a new researcher
  if (preferNew || secureRandomInt(5) === 0) {
