     1/**
     2 * Wiki Next Task Selector
     3 *
     4 * The main entry point for autonomous agent operation.
     5 * Uses true randomness combined with ecosystem state to determine:
     6 * 1. What type of task to perform (repair vs. create)
     7 * 2. Which specific topic to address
     8 * 3. Which researcher to feature
     9 *
    10 * Returns a complete task specification for the agent.
    11 */
    12
    13import { ToolModule } from "../types.js";
    14import * as fs from "fs";
    15import * as path from "path";
    16import * as crypto from "crypto";
    17
    18const WIKI_DIR = path.join(process.cwd(), "not-wikipedia");
    19const ECOSYSTEM_FILE = path.join(process.cwd(), "ecosystem.json");
    20const RESEARCHERS_FILE = path.join(process.cwd(), "researchers.json");
    21
    22interface TaskSpec {
    23  taskType: "repair_broken_link" | "resolve_placeholder" | "fix_orphan" | "create_new" | "ecosystem_healthy";
    24  priority: "critical" | "high" | "medium" | "low";
    25  topic: {
    26    name: string;
    27    filename: string;
    28    context: string;
    29  };
    30  researcher: {
    31    name: string;
    32    field: string;
    33    institution: string;
    34    isNew: boolean;
    35  } | null;
    36  articleType: string;
    37  category: string;
    38  infoboxColor: string;
    39  randomSeed: string;
    40  ecosystemStats: {
    41    totalArticles: number;
    42    brokenLinks: number;
    43    orphans: number;
    44    placeholders: number;
    45  };
    46}
    47
    48function secureRandomInt(max: number): number {
    49  if (max <= 0) return 0;
    50  const randomBytes = crypto.randomBytes(4);
    51  const randomValue = randomBytes.readUInt32BE(0);
    52  return randomValue % max;
    53}
    54
    55function secureRandomElement<T>(arr: T[]): T | null {
    56  if (arr.length === 0) return null;
    57  return arr[secureRandomInt(arr.length)];
    58}
    59
    60// Available infobox colors (pick unused ones)
    61const INFOBOX_COLORS = [
    62  "#7b9e89", "#c9a86c", "#8b7355", "#d4a87a",
    63  "#a6c4d4", "#b8a8d4", "#98d1a8", "#e6c88a",
    64  "#9fc5e8", "#f9cb9c", "#b4a7d6", "#a2c4c9",
    65];
    66
    67// Article types for rotation
    68const ARTICLE_TYPES = [
    69  "phenomenon", "theory", "methodology", "practice",
    70  "institution", "biography", "historical_event", "case_study",
    71];
    72
    73// Categories to balance
    74const CATEGORIES = [
    75  "linguistics", "consciousness", "chronopsychology", "technology", "institutions",
    76];
    77
    78function getEcosystemState() {
    79  const state = {
    80    brokenLinks: [] as { target: string; sources: string[] }[],
    81    placeholders: [] as string[],
    82    orphans: [] as string[],
    83    articleCount: 0,
    84    usedColors: [] as string[],
    85    categoryBalance: {} as Record<string, number>,
    86  };
    87
    88  try {
    89    const files = fs.readdirSync(WIKI_DIR).filter(f => f.endsWith(".html"));
    90    state.articleCount = files.length;
    91
    92    const incomingLinks: Map<string, number> = new Map();
    93    files.forEach(f => incomingLinks.set(f, 0));
    94
    95    for (const file of files) {
    96      const filePath = path.join(WIKI_DIR, file);
    97      const content = fs.readFileSync(filePath, "utf-8");
    98
    99      // Check broken links
   100      const linkMatches = content.matchAll(/href="([^"]*\.html)"/g);
   101      for (const match of linkMatches) {
   102        const link = match[1];
   103        if (!fs.existsSync(path.join(WIKI_DIR, link))) {
   104          const existing = state.brokenLinks.find(b => b.target === link);
   105          if (existing) {
   106            existing.sources.push(file);
   107          } else {
   108            state.brokenLinks.push({ target: link, sources: [file] });
   109          }
   110        } else {
   111          incomingLinks.set(link, (incomingLinks.get(link) || 0) + 1);
   112        }
   113      }
   114
   115      // Check placeholders
   116      if (content.includes("NEXT_PAGE_PLACEHOLDER")) {
   117        state.placeholders.push(file);
   118      }
   119
   120      // Extract used colors
   121      const colorMatch = content.match(/background-color:\s*(#[a-fA-F0-9]{6})/);
   122      if (colorMatch) {
   123        state.usedColors.push(colorMatch[1].toLowerCase());
   124      }
   125    }
   126
   127    // Find orphans
   128    for (const [file, count] of incomingLinks) {
   129      if (file !== "index.html" && count === 0) {
   130        state.orphans.push(file);
   131      }
   132    }
   133
   134    // Load category balance
   135    if (fs.existsSync(ECOSYSTEM_FILE)) {
   136      const ecosystem = JSON.parse(fs.readFileSync(ECOSYSTEM_FILE, "utf-8"));
   137      state.categoryBalance = {};
   138      for (const [cat, data] of Object.entries(ecosystem.categories || {})) {
   139        state.categoryBalance[cat] = (data as any).article_count || 0;
   140      }
   141    }
   142
   143  } catch (error) {
   144    // Continue with partial state
   145  }
   146
   147  return state;
   148}
   149
   150function getAvailableResearcher(): { name: string; field: string; institution: string; isNew: boolean } | null {
   151  try {
   152    if (fs.existsSync(RESEARCHERS_FILE)) {
   153      const data = JSON.parse(fs.readFileSync(RESEARCHERS_FILE, "utf-8"));
   154
   155      // 20% chance to suggest new researcher
   156      if (secureRandomInt(5) === 0 && data.suggested_new_researchers?.length > 0) {
   157        const newR = secureRandomElement(data.suggested_new_researchers) as { name: string; field: string; institution: string } | null;
   158        if (newR) {
   159          return {
   160            name: newR.name,
   161            field: newR.field,
   162            institution: newR.institution,
   163            isNew: true,
   164          };
   165        }
   166      }
